import React from 'react';
import BasicSelect from '../../Components/Select';
import BasicDatePicker from'../../Components/Data/Data'
import { TextField } from '@mui/material';
import { Button } from '@mui/material';
import './style.css'


// import { Container } from './styles';

function FormCadastro() {
  return (
      <>
      <div>
        <TextField id="outlined-basic" label="Nº Registro" variant="outlined" />
        <TextField id="outlined-basic" label="Usuário do Cadastro" variant="outlined" />
        <BasicSelect className='selects'/> 
        <BasicDatePicker className='data'/>
      </div>
      <div>
        <TextField id="outlined-basic" label="Cod " variant="outlined" />
        <TextField id="outlined-basic" label="Coligada" variant="outlined" />
        <Button variant="outlined">Atualizar Situacao</Button>
      </div>
      <div>
        <TextField id="outlined-basic" label="Cod. Filial" variant="outlined" />
        <TextField id="outlined-basic" label="Filial" variant="outlined" />
        <TextField id="outlined-basic" label="Setor" variant="outlined" />
      </div>


      </>
  );
}

export default FormCadastro;
